import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from "./home";
import About from "./about";
import Contact from "./contact";
import BookTickets from "./booktickets";
import './App.css';
import AdminAccess from "./AdminAccess";



function App() {
  // State to handle modal visibility
  const [isAdminModalOpen, setAdminModalOpen] = useState(false);

  // Function to toggle modal
  const handleAdminModal = () => {
    setAdminModalOpen(!isAdminModalOpen);
  };

  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
            <li>
              <Link to="/book-tickets">Book Tickets</Link>
            </li>
            <li>
              {/* Button to trigger admin login modal */}
              <button className="admin-btn" onClick={handleAdminModal}>
                Admin Login
              </button>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/book-tickets" element={<BookTickets />} />
        </Routes>

        {/* Render the admin login modal if isAdminModalOpen is true */}
        {isAdminModalOpen && <AdminAccess closeModal={handleAdminModal} />}
      </div>
    </Router>
  );
}

export default App;
